import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
function App() {
  return (
    <div>
      <Header />
      <main className="container my-4">
        <h2>Welcome to My Website</h2>
        <p>This is a simple React application with a Bootstrap header and footer.</p>
      </main>
      <Footer />
    </div>
  );
}

export default App;
